import * as s from '../styles/PaymentInfoStyle';

export const PaymentInfo = () => {
  return (
    <s.PaymentInfoContainer>
      <s.PaymentInfoUl>
        <s.PaymentInfoLi>신용/체크카드</s.PaymentInfoLi>
        <s.PaymentInfoLi>간편카드결제</s.PaymentInfoLi>
        <s.PaymentInfoLi>페이코</s.PaymentInfoLi>
        <s.PaymentInfoLi>토스페이</s.PaymentInfoLi>
        <s.PaymentInfoLi>카카오페이</s.PaymentInfoLi>
        <s.PaymentInfoLi>네이버페이</s.PaymentInfoLi>
        <s.PaymentInfoLi>휴대폰결제</s.PaymentInfoLi>
        <s.PaymentInfoLi>실시간 계좌이체</s.PaymentInfoLi>
      </s.PaymentInfoUl>
    </s.PaymentInfoContainer>
  );
};

export default PaymentInfo;
